import styled from "styled-components";

export const Container = styled.div`
  padding: 1.5rem;

  .alerts {
    color: red;
    background-color: #e4eeb7;
    width: fit-content;
    padding: 1rem 1.5rem;
    border-radius: 50%;
  }
`;
